function start_hyper(e = { timeOut: 500 }) {
  $("#testar").html("Please wait....");
  var t = $("#amount").val() ? $("#amount").val() : 1,
    a = $("#teleid").val() ? $("#teleid").val() : "123",
    o = $("#curr").val() ? $("#curr").val() : "inr",
    n = $("#skkey").val(),
    r = $("#lista").val().split("\n"),
    l = r.length,
    s = 0,
    i = 0,
    c = 0,
    d = 0;
  (function (e = "curr") {
    "curr" === e && window.alert("Please select a valid currency");
  })(o),
    (function (e) {
      null !== e || "" !== e
        ? window.localStorage.setItem("getsk", e)
        : e !== window.localStorage.getItem("getsk") &&
          window.localStorage.setItem("getsk", e);
    })(n),
    (function (e) {
      "curr" !== e || "" !== e
        ? window.localStorage.setItem("curr", e)
        : e !== window.localStorage.getItem("curr") &&
          window.localStorage.setItem("curr", e);
    })(o),
    (function (e) {
      "123" !== e || "" !== e
        ? window.localStorage.setItem("teleid", e)
        : e !== window.localStorage.getItem("teleid") &&
          window.localStorage.setItem("teleid", e);
    })(a),
    r.forEach(function (r, u) {
      setTimeout(function () {
        $.ajax({
          url:
            "gate.php?lista=" +
            r +
            "&amount=" +
            t +
            "&skkey=" +
            n +
            "&tgid=" +
            a +
            "&curr=" +
            o,
          type: "GET",
          async: !0,
          success: function (e) {
            e.match("#LIVE")
              ? (removelinha(),
                d++,
                charged(e + ""),
                tata.success("", e, { duration: 5e3 }))
              : e.match("#CVV")
              ? (removelinha(),
                s++,
                aprovadas(e + ""),
                tata.success("", e, { duration: 5e3 }))
              : e.match("#CCN")
              ? (removelinha(), i++, edrovadas(e + ""))
              : (removelinha(), c++, reprovadas(e + "")),
              $("#carregadas").html(l);
            var t = parseInt(d) + parseInt(s) + parseInt(i) + parseInt(c);
            $("#cLive").html(s),
              $("#cWarn").html(i),
              $("#cDie").html(c),
              $("#total").html(t),
              $("#cLive3").html(d),
              $("#cLive2").html(s),
              $("#cWarn2").html(i),
              $("#cDie2").html(c);
            var a = (t / l) * 100,
              o = "[" + t + " checked] processing..." + a.toFixed(0) + "%";
            $(".gline").css({ width: a.toFixed(0) + "%" }),
              $("#testar").html(o),
              100 === a && $("#testar").html("✅ checking completed!");
          },
        });
      }, e.timeOut * u);
    });
}
function charged(e) {
  $(".charged").append(e + "<br>");
}
function aprovadas(e) {
  $(".aprovadas").append(e + "<br>");
}
function reprovadas(e) {
  $(".reprovadas").append(e + "<br>");
}
function edrovadas(e) {
  $(".edrovadas").append(e + "<br>");
}
function removelinha() {
  var e = $("#lista").val().split("\n");
  e.splice(0, 1), $("#lista").val(e.join("\n"));
}
$(document).ready(() => {
  $("#tbar").hide(),
    ((e = {}) => {
      console.log(
        `\n-----------\nName: ${e.name}\nStatus: ${e.status}\nVersion: ${e.version}\nCreator: ${e.author}\n-----------\n\n`
      );
    })({
      name: "Synax",
      version: "1.0.1b",
      author: "Biswa.js",
      status: "✅ intialized",
    }),
    (function () {
      if (!window.localStorage)
        return window.alert(
          "Please update your browser or use different browser."
        );
      if (null !== window.localStorage.getItem("curr"))
        return (
          (document.getElementById("curr").value =
            window.localStorage.getItem("curr")),
          $("#testar").show(),
          $("#testar").addClass("animate__animated animate__jackInTheBox")
        );
      $("#testar").hide();
    })(),
    (function () {
      if (!window.localStorage)
        return window.alert(
          "Please update your browser or use different browser."
        );
      if (null !== window.localStorage.getItem("getsk"))
        return (
          (document.getElementById("skkey").value =
            window.localStorage.getItem("getsk")),
          $("#skCon").removeClass("col-md-12"),
          $("#skCon").addClass("col-md-6")
        );
      $("#skCon").hide(), $("#curCon").hide();
    })(),
    window.localStorage
      ? null !== window.localStorage.getItem("teleid") &&
        (document.getElementById("teleid").value =
          window.localStorage.getItem("teleid"))
      : window.alert("Please update your browser or use different browser."),
    $("#lista").keyup(() => {
      $("#skCon").show(),
        $("#skCon").addClass("animate__animated animate__bounceIn");
    }),
    $("#curr").on("change", () => {
      $("#testar").show(),
        $("#testar").addClass("animate__animated animate__jackInTheBox");
    }),
    $("#skCon").keyup(() => {
      $("#curCon").show(),
        $("#skCon").removeClass("col-md-12"),
        $("#skCon").addClass("col-md-6 animate__animated animate__rotateIn");
    }),
    $("#skkey").keyup(function () {
      var e = this.value;
      $.ajax({
        url: "sk.php?key=" + this.value,
        type: "GET",
        async: !0,
        success: function (t) {
          e.startsWith("sk_live") &&
            (t.includes("#LIVE")
              ? tata.success("Live Key", e.slice(0, 20) + "xxx", {
                  duration: 5e3,
                  position: "mm",
                })
              : tata.error(t, e.slice(0, 20) + "xxx", {
                  duration: 5e3,
                  position: "mm",
                }));
        },
      });
    });
}),
  $(document).ready(function () {
    $("#bode").hide(),
      $("#bode4").hide(),
      $("#esconde").show(),
      $("#mostra4").click(function () {
        $("#bode4").slideToggle();
      }),
      $("#mostra").click(function () {
        $("#bode").slideToggle();
      }),
      $("#mostra3").click(function () {
        $("#bode3").slideToggle();
      }),
      $("#mostra2").click(function () {
        $("#bode2").slideToggle();
      });
  });
